de:
Avenant n°1 au protocole d'accord: 1. nouvelle partie contrac-tuelle: Kosovo (au lieu de la MINUK);
2. Rapport au nouvel accord cadre entre la Suisse et le Kosovo, signé le 6 octobre 2010;
3. Augmentation de la contribution suisse à 10 180 000 francs (anciennement 8 160 000 francs);
4. Extension de la validité de l'accord au 31.12.2012 
 - 14-12-2010 - Verständigungsprotokoll zwischen der Schweiz und der UNMIK, im Namen von KEK JSC (Korporata Energjetike e Kosoves Sh.a), betreffend die Finanzhilfe für das Projekt "Gjilani V Substation"

